import React, {Component} from 'react';

class AddUserComponent extends Component {

    constructor(props) {
        super(props);
        this.state = {}
    }


    render() {
        return (
            <div className="container">
                <div className="row">
                    <div className="card col-md-6 offset-md-3">
                        
                    </div>
                </div>

            </div>
        );
    }
}

export default AddUserComponent;
